import _Document, {
  Html,
  Head,
  Main,
  NextScript,
  DocumentContext
} from 'next/document';
import { AppRegistry } from 'react-native';

export default class Document extends _Document {
  static async getInitialProps({ renderPage }: DocumentContext) {
    AppRegistry.registerComponent('isomorphic', () => Main);
    return renderPage();
  }

  render(): JSX.Element {
    return (
      <Html>
        <Head title="Isoworld" />
        <body>
          <Main />
          <NextScript />
        </body>
      </Html>
    );
  }
}
